/** @format */

import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

// import required modules
import { Autoplay, Pagination, Navigation } from 'swiper';

function Members() {
	return (
		<>
			<div className='w-full'>
				<img
					className=''
					src='https://team.daangn.com/static/6b6f5c645b84541bd97f2ab51bf29df1/66698/58acfc5c-9d91-4c4d-86b9-60af8c94bc16_photo_11.avif'
				/>
				<div className='base-m'>
					<p className='w-4/5'>
						건설적인 비판과 피드백을 줄 수 있는 동료와 일하고 있어요. 모두가
						자기가 제일 잘하는 분야에서 권한과 책임을 가진 리더에요. 하나의
						서비스를 만들기 위해, 형식보단 일에 집중할 수 있는 환경 속에서
						빠르게 성장하고 있어요.
					</p>
					<div className='base-m team-role'>
						<strong>이름</strong>
						<span> 역할</span>
						<span>깃허브</span>
					</div>
				</div>
			</div>
			<Swiper
				spaceBetween={30}
				centeredSlides={true}
				// autoplay={{
				// 	delay: 2500,
				// 	disableOnInteraction: false,
				// }}
				pagination={{
					clickable: true,
				}}
				navigation={true}
				modules={[Autoplay, Pagination, Navigation]}
				className='mySwiper'
			>
				<SwiperSlide>
					<img
						className='object-fill w-full h-96'
						src='https://cdn.pixabay.com/photo/2022/03/20/15/40/nature-7081138__340.jpg'
						alt='image slide 1'
					/>
				</SwiperSlide>
				<SwiperSlide>
					<img
						className='object-fill w-full h-96'
						src='https://cdn.pixabay.com/photo/2022/07/24/17/55/wind-energy-7342177__340.jpg'
						alt='image slide 2'
					/>
				</SwiperSlide>
				<SwiperSlide>
					<img
						className='object-fill w-full h-96'
						src='https://cdn.pixabay.com/photo/2022/07/26/03/35/jogger-7344979__340.jpg'
						alt='image slide 3'
					/>
				</SwiperSlide>
			</Swiper>
		</>
	);
}

export default Members;
